String.prototype.insertAt=function(t,e){return this.substring(0,t)+e+this.substring(t)};String.prototype.replaceAll=function(t,e){return this?typeof this=="number"||typeof this=="boolean"?this:this.replace(new RegExp(t,"g"),e):""};String.prototype.replaceAlls=function(t,e){if(!t||!e)return this;let r=this.replaceAll(t[0],e[0]);for(let n=1;n<t.length;n++)r=r.replaceAll(t[n],e[n]);return r};String.prototype.unaccent=function(){let t=this;return t=t.toLowerCase(),t=t.replace(/à|á|ạ|ả|ã|â|ầ|ấ|ậ|ẩ|ẫ|ă|ằ|ắ|ặ|ẳ|ẵ/g,"a"),t=t.replace(/è|é|ẹ|ẻ|ẽ|ê|ề|ế|ệ|ể|ễ/g,"e"),t=t.replace(/ì|í|ị|ỉ|ĩ/g,"i"),t=t.replace(/ò|ó|ọ|ỏ|õ|ô|ồ|ố|ộ|ổ|ỗ|ơ|ờ|ớ|ợ|ở|ỡ/g,"o"),t=t.replace(/ù|ú|ụ|ủ|ũ|ư|ừ|ứ|ự|ử|ữ/g,"u"),t=t.replace(/ỳ|ý|ỵ|ỷ|ỹ/g,"y"),t=t.replace(/đ/g,"d"),t=t.replace(/\u0300|\u0301|\u0303|\u0309|\u0323/g,""),t=t.replace(/\u02C6|\u0306|\u031B/g,""),t};String.prototype.toBool=function(){return JSON.parse(this.toLowerCase())};String.prototype.isEmpty=function(){return typeof this!="string"?this===null||this===void 0:this===null||this===void 0||this.trim().length===0};String.prototype.replaceAfter=function(t,e,r){return this.length>r?this.slice(0,r)+this.slice(r).replace(t,e):this};String.prototype.toTitleCase=function(){return this?this.replace(/\w\S*/g,function(t){return t.charAt(0).toUpperCase()+t.substr(1).toLowerCase()}):this};String.prototype.removeExtraSpace=function(){return this?this.replace(/\s+/g," "):this};String.prototype.countSubString=function(t){return this?this.split(t).length-1:0};
